def make_state(hand):
    states = []
    for idx in hand:
        state = [0 for i in range(17)]
        state[idx // 4] = 1
        state[idx % 4 + 13] = 1
        states += state
    return states

def relu(x):
    return x * (x > 0)

def softmax(x):
    e_x = np.exp(x - np.max(x))
    return e_x / e_x.sum()

def dense(inp, weights, bias):
    return inp @ weights + bias

def run_model(inp, weights, biases):
    for i in range(len(weights) - 1):
        inp = relu(dense(inp, weights[i], biases[i]))

    return softmax(dense(inp, weights[-1], biases[-1]))

def get_optimal_play(hand, pool=None):
    inp = np.array([make_state(hand)])

    # Test time augmentation!
    perms = [get_random_permutation() for i in range(10)]
    batch = [permute_hand(inp[0], j) for j in perms]
    #suits = [get_random_suits() for i in range(10)]
    #batch = [switch_suits(permute_hand(inp[0], j), k) for j, k in zip(perms, suits)]
    inp = np.append(inp, np.array(batch), axis=0)

    preds = run_model(inp, weights, biases)
    perms = np.concatenate(([[0, 1, 2, 3, 4]], perms), axis=0)
    preds = [permute_probs(i, invert_permutation(j)) for i, j in zip(preds, perms)]
    return np.argmax(np.sum(preds, axis=0))

def permute_action(action, p):
    action = 25 - action
    if action == 0:
        return 25
    if action < 6:
        return 25 - (p[action - 1] + 1)
    remove = [[0, 1], [0, 2], [0, 3], [0, 4], [1, 2], [1, 3], [1, 4], [2,3], [2, 4], [3, 4]]
    if action < 16:
        toremove = sorted([p[i] for i in remove[action - 6]])
        return 25 - (remove.index(toremove) + 6)
    tokeep = sorted([p[i] for i in remove[action - 16]])
    return 25 - (remove.index(tokeep) + 16)

def permute_hand(hand, p):
    h = np.reshape(hand, (5, 17))
    return np.reshape(np.array([h[i] for i in invert_permutation(p)]), (5 * 17,))

def permute_probs(probs, p):
    return [probs[permute_action(i, invert_permutation(p))] for i in range(26)]

def invert_permutation(p):
    n = [0 for i in range(len(p))]
    for i, loc in enumerate(p):
        n[loc] = i
    return n

def get_random_permutation():
    return np.random.permutation(5)

def get_random_suits():
    return np.random.permutation(4)

def get_suit(card):
    return np.where(card[-4:] == 1.)[0][0]

def switch_suits(hand, suit_perm):
    h = np.reshape(hand, (5, 17))
    for card in h:
        suit = get_suit(card)
        card[suit + 13] = 0
        card[suit_perm[suit] + 13] = 1
    return np.reshape(h, (5 * 17, ))

def print_output(action, hand):
    action = 25 - action
    if action == 0:
        print(0)
        return
    if action < 6:
        print(1, end=' ')
        print(hand[action - 1])
        return
    remove = [[0,1], [0,2], [0,3], [0,4], [1,2], [1,3], [1,4], [2,3], [2,4], [3,4]]
    if action < 16:
        print(2, end=' ')
        to_remove = remove[action - 6]
        print(*(hand[i] for i in to_remove))
        return
    to_keep = remove[action - 16]
    print(3, end=' ')
    print(*(hand[i] for i in range(5) if i not in to_keep))


if __name__ == '__main__':
    while True:
        hand = [int(i) for i in input().split()]
        play = get_optimal_play(hand)
        print_output(play, hand)
